import React from "react";
import "./styles.css";

const OutputDocument = ({ output, downloadOutput, mergedPdfUrl}) => {
  return (
    <div >
      <div className="file-display-box" >
        {output}
      </div>
      {mergedPdfUrl && (
        <button className="download-button"
        href={mergedPdfUrl} download="merged.pdf">
          Download Merged PDF
        </button>
      )}
    </div>
  );
};

export default OutputDocument;
